import { Component, OnInit } from '@angular/core';
import { ActivatedRoute, Router } from '@angular/router';
import { of } from 'rxjs';
import { map, switchMap } from 'rxjs/operators';
import { FlightService } from '../issue.service';
import { Issue } from '../issues';

@Component({
  selector: 'app-issue-edit',
  templateUrl: './issue-edit.component.html'
})
export class IssueEditComponent implements OnInit {

  id!: string;
  issue!: Issue;
  feedback: any = {};

  constructor(
    private route: ActivatedRoute,
    private router: Router,
    private flightService: FlightService) {
  }

  ngOnInit() {
    this
      .route
      .params
      .pipe(
        map(p => p.id),
        switchMap(id => {
          if (id === 'new') { return of(new Issue()); }
          return this.flightService.findById(id);
        })
      )
      .subscribe(issue => {
        this.issue = issue;
        this.feedback = {};
      },
        err => {
          this.feedback = { type: 'warning', message: 'Error loading' };
        }
      );
  }

  save() {
    this.flightService.save(this.issue).subscribe(
      issue => {
        this.issue = issue;
        this.feedback = { type: 'success', message: 'Save was successful!' };
        setTimeout(() => {
          this.router.navigate(['/flights']);
        }, 1000);
      },
      err => {
        this.feedback = { type: 'warning', message: 'Error saving' };
      }
    );
  }

  cancel() {
    this.router.navigate(['/flights']);
  }
}
<nav aria-label="breadcrumb">
  <ol class="breadcrumb">
    <li class="breadcrumb-item"><a routerLink="/">Home</a></li>
    <li class="breadcrumb-item active">Issues</li>
  </ol>
</nav>
<div class="card">
  <div class="header">
    <h2 class="title">Issues Detail</h2>
  </div>
  <div class="content">
    <div *ngIf="feedback.length" class="alert alert-{{feedback.type}}">{{ feedback.message }}</div>
    <form *ngIf="issue" #editForm="ngForm" (ngSubmit)="save()">

      <div class="form-group">
        <label for="id">Id</label>
        <input type="number" [(ngModel)]="issue.id" id="id" name="id" class="form-control">
      </div>

      <div class="form-group">
        <label for="from">From</label>
        <input [(ngModel)]="issue.from" id="from" name="from" class="form-control">
      </div>

      <div class="form-group">
        <label for="to">To</label>
        <input [(ngModel)]="issue.to" id="to" name="to" class="form-control">
      </div>

      <div class="form-group">
        <label for="date">Date</label>
        <input type="date" [(ngModel)]="issue.date" id="date" name="date" class="form-control">
      </div>

      <button type="submit" class="btn btn-primary" [disabled]="!editForm.form.valid">Save</button>
      <button type="button" class="btn btn-secondary" (click)="cancel()">Cancel</button>
    </form>
  </div>
</div>
